if (!(window === window.parent)) {
	// iframes get the wall too
	setTimeout(() => {
		document.querySelector("html").innerHTML = `
			<style>
				html, body {
					height: 100%;
					margin: 0;
					padding: 0;
				}
				div, img {
					height: 100%;
					display: flex;
					align-items: center;
					justify-content: center;
					width: auto;
				}
			</style>
			<div><img title="STOP USING THAT FUCKING WEBSITE" src="data:image/gif;base64,"></div>
		`;
	}, 20);
} else {
	document.querySelector("html").innerHTML = `
		<style>
			html, body {
				height: 100%;
				margin: 0;
				padding: 0;
			}
			div, img {
				height: 100%;
				display: flex;
				align-items: center;
				justify-content: center;
				width: auto;
			}
		</style>
		<div><img title="STOP USING THAT FUCKING WEBSITE" src="data:image/gif;base64,"></div>
	`
}